import React, { useState, useEffect } from "react";
import axios from "axios";

function Tagresult(props){
    const [data, setData] = useState([]);
    // const data = [
    //     {
    //     'songName' : 'a',
    //     'artistName' : 'a',
    //     'url' : 'https://i.scdn.co/image/ab67616d0000b2734ed058b71650a6ca2c04adff',
    //     },
    //     {
    //         'songName' : 'b',
    //         'artistName' : 'b',
    //         'url' : 'https://i.scdn.co/image/ab67616d0000b273b94bb18d775fd6d0127d1ee2',
    //     },        
    //     {
    //         'songName' : 'c',
    //         'artistName' : 'c',
    //         'url' : 'https://i.scdn.co/image/d38e330c69ce1695d5c2a7487169b0d4fa48dd93',
    //     },        
    //     {
    //         'songName' : 'd',
    //         'artistName' : 'd',
    //     },        
    //     {
    //         'songName' : 'e',
    //         'artistName' : 'e',
    //     },                                
    // ]
    const [selectedSongs, setSelectedSongs] = useState(new Set()); // 선택된 아이템 집합    
    const [selectedIds, setSelectedIds] = useState(new Set());    
    const userId = JSON.parse(localStorage.getItem('user')).id;    

    const getResult = async() => {
        try {     
            const response = await axios.get(`http://localhost:8080/api/annoy/recommend-songs/${userId}`);
            setData(response.data);
            console.log(response);
        } catch (e) {
            console.log(e);
        }
    };

    useEffect(() => {
        getResult();
      }, []);

      const handleSongClick = (song) => {
        setSelectedSongs((prevSongs) => {
          const newSongs = new Set(prevSongs); // 이전 선택된 아이템 집합 복사
            newSongs.add(song);
          return newSongs;
        });
      };

      const handleIdClick = (song) => {
        setSelectedIds((prevIds) => {
          const newIds = new Set(prevIds); // 이전 선택된 아이템 집합 복사
            newIds.add(song);
          return newIds;
        });
      };          


  
    return (
      
        <div className="cent" style={{ margin: "20px", width: "100%" }}>
        <div style={{ display: "flex", justifyContent: "center" }}>
          <table className="td800">
            <tbody>
              <tr>
                <td colSpan="4" style={{ textAlign: "left" }}>
                  <p>당신이 좋아할만한 노래</p>
                </td>
              </tr>
              <tr style={{ fontSize : '16px', textAlign: 'left' }}>
              <td className="td400">
                <div style={{display : 'flex', flexDirection: 'row'}}>
                <img onClick={() => {handleSongClick(data[0].songName); handleIdClick(data[0].id);} }  alt = "song" src={data[0].url} width="50" height="50"/>                         
                <div style = {{ marginLeft : '10px' }}>
                  <span onClick={() => {handleSongClick(data[0].songName); handleIdClick(data[0].id);}}>
                    {data[0].songName}
                  </span>
                  <p onClick={() => {handleSongClick(data[0].songName); handleIdClick(data[0].id);}} style={{ fontSize: '10px', textAlign: 'left' }} >{data[0].artistName}</p>                  
                </div>
                </div>                
              </td>
              </tr>
              <tr style={{ fontSize : '16px', textAlign: 'left' }} >
              <td className="td400">
                <div style={{display : 'flex', flexDirection: 'row'}} >
                  <img onClick={() => {handleSongClick(data[1].songName); handleIdClick(data[1].id);}} alt = "song" src={data[1].url} width="50" height="50"/>                  
                  <div style = {{ marginLeft : '10px' }} >
                  <span onClick={() => {handleSongClick(data[1].songName); handleIdClick(data[1].id);}}>
                    {data[1].songName}
                  </span>
                  <p onClick={() => {handleSongClick(data[1].songName); handleIdClick(data[1].id);}} style={{ fontSize: '10px', textAlign: 'left' }} >{data[1].artistName}</p>
                </div>
                </div>
              </td>
              </tr>
              <tr style={{ fontSize : '16px', textAlign: 'left' }}>
              <td className="td400">
                <div style={{display : 'flex', flexDirection: 'row'}} >
                <img onClick={() => {handleSongClick(data[2].songName); handleIdClick(data[2].id);} }  alt = "song" src={data[2].url} width="50" height="50"/>                         
                <div style = {{ marginLeft : '10px' }}>
                  <span onClick={() => {handleSongClick(data[2].songName); handleIdClick(data[2].id);}}>
                    {data[2].songName}
                  </span>
                  <p onClick={() => {handleSongClick(data[2].songName); handleIdClick(data[2].id);}} style={{ fontSize: '10px', textAlign: 'left' }} >{data[2].artistName}</p>                  
                </div>
                </div>                
              </td>
              </tr>
              <tr style={{ fontSize : '16px', textAlign: 'left' }} >
              <td className="td400">
                <div style={{display : 'flex', flexDirection: 'row'}} >
                  <img onClick={() => {handleSongClick(data[3].songName); handleIdClick(data[3].id);}} alt = "song" src={data[3].url} width="50" height="50"/>                  
                  <div style = {{ marginLeft : '10px' }} >
                  <span onClick={() => {handleSongClick(data[3].songName); handleIdClick(data[3].id);}}>
                    {data[3].songName}
                  </span>
                  <p onClick={() => {handleSongClick(data[3].songName); handleIdClick(data[3].id);}} style={{ fontSize: '10px', textAlign: 'left' }} >{data[3].artistName}</p>
                </div>
                </div>
              </td>
              </tr>
              <tr style={{ fontSize : '16px', textAlign: 'left' }}>
              <td className="td400">
                <div style={{display : 'flex', flexDirection: 'row'}} >
                <img onClick={() => {handleSongClick(data[4].songName); handleIdClick(data[4].id);} }  alt = "song" src={data[4].url} width="50" height="50"/>                         
                <div style = {{ marginLeft : '10px' }}>
                  <span onClick={() => {handleSongClick(data[4].songName); handleIdClick(data[0].id);}}>
                    {data[4].songName}
                  </span>
                  <p onClick={() => {handleSongClick(data[4].songName); handleIdClick(data[4].id);}} style={{ fontSize: '10px', textAlign: 'left' }} >{data[4].artistName}</p>                  
                </div>
                </div>                
              </td>
              </tr>
            </tbody>
          </table>
        </div>
    </div>

  
      
    );
  };
  
  export default Tagresult;
